--
-- Name: density_data; Type: TABLE; Schema: public; Owner: adicu; Tablespace: 
--
DROP TABLE density_data CASCADE;
CREATE TABLE density_data (
    dump_time timestamp without time zone NOT NULL,
    group_id integer NOT NULL,
    group_name text,
    parent_id integer,
    parent_name text,
    client_count integer
);


ALTER TABLE public.density_data OWNER TO adicu;

--
-- Name: day_window; Type: MATERIALIZED VIEW; Schema: public; Owner: adicu; Tablespace: 
--

CREATE MATERIALIZED VIEW day_window AS
 SELECT date_trunc('day'::text, density_data.dump_time) AS day,
    density_data.group_id,
    density_data.group_name,
    density_data.parent_id,
    density_data.parent_name,
    avg(density_data.client_count) AS average_count,
    max(density_data.client_count) AS max_count,
    min(density_data.client_count) AS min_count
   FROM density_data
  GROUP BY density_data.group_id, density_data.group_name, density_data.parent_id, density_data.parent_name, date_trunc('day'::text, density_data.dump_time)
  WITH NO DATA;


ALTER TABLE public.day_window OWNER TO adicu;

